Storyline:

    Kelly, a prostitute, finds redemption in the town of Grantville, where she arrives working as a medium-time seller. There, she meets Griff, the police captain of the town, with whom she spends a romantic afternoon. The woman, traumatized by an experience in the past called &quot;The Naked Kiss&quot; by psychiatrists, finally, finds a job as a nurser in a Hospital for handicapped children, experience that allows her to find a sensitive side in caring and patiently love each one of her little patients. Apparently, Kelly will find happiness in Grant, her fiance and Griff's partner, but she will be the witness of a shocking event that will threaten this happiness and even her mental health.




